def m_sort(x):
    if len(x) < 2:
        return x
    x1 = m_sort(x[:len(x)/2])
    x2 = m_sort(x[len(x)/2:])
    sorted_x = []
    while len(x1) > 0 or len(x2) > 0:
        if len(x1) > 0 and len(x2) > 0:
            if x1[0] < x2[0]:
                sorted_x.append(x1[0])
                x1.pop(0)
            else:
                sorted_x.append(x2[0])
                x2.pop(0)
        else:
            sorted_x = sorted_x + x1 + x2
            break
    return sorted_x
